import './App.css';
import {useEffect, useState} from "react";

function App() {
  const URL = "https://api.thecatapi.com/v1";
  const APIKEY = "33ed03ef-e254-42e6-854f-9e536360308c";


  const [items, setItems] = useState([]);
  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false)

  useEffect(() => {
    const CRITERIA = "images/search"
    const ADDRESS = URL + "/" + CRITERIA + "?api_key=" + APIKEY
    fetch(ADDRESS)
    .then(res => res.json())
    .then(
      (result) => {
        setError(null);
        setIsLoaded(true);
        setItems(result.breeds)
      }, (error) => {
        setError(error);
        setIsLoaded(true);
        setItems([])
      }
    )


  }, [])


  if (error) {
    return <p>{error.message}</p>
  } else if (!isLoaded) {
    return <p>Ladataan...</p>
  } else {
    return (
      <div>
        {items.map(item=> {
          <div key={item.id}>
            <img src={item.url}></img>
          </div>
        })}
      </div>
    );
  }

}

export default App;
